import React from "react"

export const AboutEducation = () => {
    const educationInformation = [
        {institute: "Pellissippi State Community College", startDate: "Aug. 2022", endDate: "May 2023", GPA: 3.96},
        {institute: "University of Tennessee, Knoxville", startDate: "Aug. 2023", endDate: "May 2026", GPA: 4.0},
    ]

    return (
        <>
            <h2 className="Education-Title">Education</h2>
            <div className="Education-Information">

            </div>
        </>
    )
}

export default AboutEducation;
